import {useState, useEffect} from 'react'

function Flashcard({userLanguages}){
const [flashcards, setFlashCards] = useState([])

useEffect(() => {
    fetch("/flashcards/id")
    .then((r) => {
      if (r.ok) {
        r.json().then((cards) => setFlashCards(cards));
      } else {
        setFlashCards(null)
      }
    });
  },[]);
return (
  <div>
    hello
    {console.log(flashcards)}
  </div>
)

}
export default Flashcard
